import React, { useState } from "react";
import "./page.css";

export const Mypage = () => {
  const [isHovered, setIsHovered] = useState(false);

  return (
    <div
      className="mypage"
      onMouseEnter={() => setIsHovered(true)}
      onMouseLeave={() => setIsHovered(false)}
    >
      Mypage
      {isHovered && (
        <div className="submenu">
          <div>서브메뉴1</div>
          <div>서브메뉴2</div>
        </div>
      )}
    </div>
  );
};
